$categorias = [];
$categories_id = 1;

$brands = [];
$brands_id = 1;

$packings = [];
$packings_id = 1;

$measurements = [];
$measurements_id = 1;

$products = [];
$products_id = 1;

foreach ($arr_in as $key => $fila) {
    $categoria = trim(substr($fila, 7, 29));
    if(!isset($categorias[$categoria])){
        $categorias[$categoria] = $categories_id;
        $categories_id++;
    }
    $brand = trim(substr($fila, 95, 23));
    if(!isset($brands[$brand])){
        $brands[$brand] = $brands_id;
        $brands_id++;
    }
    $packing = trim(substr($fila, 118, 57));
    if(!isset($packings[$packing])){
        $packings[$packing] = $packings_id;
        $packings_id++;
    }
    $measurement = trim(substr($fila, 175, 62));
    if(!isset($measurements[$measurement])){
        $measurements[$measurement] = $measurements_id;
        $measurements_id++;
    }

    $output = [
        'id' => $products_id++,
        'barcode' => trim(substr($fila, 0, 7)),
        'categories_id' => $categorias[$categoria],
        'detail' => trim(substr($fila, 29, 59)),
        'brands_id' => $brands[$brand],
        'packings_id' => $packings[$packing],
        'measurements_id' => $measurements[$measurement],
        'min' => trim(substr($fila, 240, 4))
    ];
    $products[] = $output;
    // print_r($output);
}
 
